import { mapState } from 'vuex'

export default {
  name: 'admin-drawer',
  computed: {
    ...mapState([
      'rightDrawer',
      'right',
    ]),
    rightDrawer: {
      get () {
        return this.$store.state.rightDrawer;
      },
      set (payload) {
        this.$store.commit('updateRightDrawer', payload)
      }
    },
    right: {
      get () {
        return this.$store.state.right;
      },
      set (payload) {
        this.$store.commit('updateRight', payload)
      }
    },
  },
}
